import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export const Home = () => {
    return (
        <>
        <Button variant="primary">
            Select Players
        </Button>{' '}
        <Card>
            <Card.Header>
                Leaderboard
            </Card.Header>
            <Card.Body>
                Play a game to begin your leaderboard.
            </Card.Body>
        </Card>
        </>
    );
  };
